import React, { Component } from 'react';
import './App.css';
import Menu from './components/Menubar/Menu';
import SideBarDraw from './components/Sidebar/SideBarDraw';
import Backdrop from './components/Backdrop/Backdrop';
import Categorie from './components/Categorie/categorie'
import Fistfilter from './components/Sidefilter/firstFiltre'
import Secondfilter from './components/Sidefilter/secondFilter'
import Thirdfilter from './components/Sidefilter/thirdFilter'
import Recherche from './components/Recherche/recherche'
import Checkbox from './components/Recherche/checkbox'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import LocationCategorie from './components/ListCategorie/locationCategorie'
import Connexion from './components/Connexion/connexion'
import MainContainer from './components/MainContainer/mainContainer'
class App extends Component {

  render(){
    return (
      <div style={{height: '100%'}} className="parent">
        <Router>
          <div>
            <Menu />
          </div>
          <Switch>
            <Route exact path="/" component={MainContainer}/>
            <Route path="/connexion" component={Connexion}/>
          </Switch>
        </Router>
        <Router>
          <Switch>
              <Route exact path="/" component={Categorie} />
              <Route path="/location" component={LocationCategorie} /> 
            </Switch>    
        </Router>
          <div className="newannonce">

          </div>
      </div>
    );
  }
}
export default App;
